import React from "react";
import { Switch, Route } from "react-router-dom";
import "./App.css";
import PatientPortal from "./pages/patient-portal/PatientPortal";
import Header from "./components/Header";
import DoctorPortal from "./pages/doctor-portal/DoctorLogIn";
import HospitalLogIn from "./pages/hospital-portal/HospitalLogIn";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      currentUser: null,
    };
  }
  render() {
    return (
      <div>
        <Header />
        <Switch>
          <Route exact path="/" component={PatientPortal} />
          <Route path="/doctorportal" component={DoctorLogIn} />
          <Route path="/hospitalportal" component={HospitalLogIn} />
        </Switch>
      </div>
    );
  }
}

export default App;
